ಈ ರೋಗಲಕ್ಷಣವನ್ನು ನೀವು ಯಾವಾಗ ಹೊಂದಿದ್ದೀರಿ? ದಯವಿಟ್ಟು ಮತ್ತು ಕೀಲಿಯನ್ನು ನಮೂದಿಸಿ(ಯುಆರ್ ಎಲ್ ಮತ್ತು ಕೀಲಿ ಯನ್ನು ನಮೂದಿಸಿ) ಅನುಮತಿ ನಿರಾಕರಿಸಲಾಗಿದೆ \\ n ನೀವು ಅನುಮತಿನಿರಾಕರಿಸಿದರೆ, ನೀವು ಈ ಸೇವೆಯನ್ನು ಬಳಸುವಂತಿಲ್ಲ| ದಯವಿಟ್ಟು ಸೆಟ್ಟಿಂಗ್ ಗಳನ್ನು ಆನ್ ಮಾಡಿ-> ಅನುಮತಿ ಪ್ರಸ್ತುತ ಸಮಯ ಕುಟುಂಬದಲ್ಲಿ ಅನಾರೋಗ್ಯದ ಇತಿಹಾಸವನ್ನು ಒದಗಿಸಲಾಗಿಲ್ಲ. ರೋಗಿಯ ಅನಾರೋಗ್ಯದ ಇತಿಹಾಸವನ್ನು ಒದಗಿಸಲಾಗಿಲ್ಲ. ನೋಂದಣಿ ಸಂಖ್ಯೆ: ಇಮೇಲ್: ಸಾರಾಂಶಕ್ಕೆ ಭೇಟಿ ನೀಡಿ ದೋಷ: ದಶಮಾಂಶೇತರ ಸಂಖ್ಯೆಯನ್ನು ನಮೂದಿಸಲಾಗಿದೆ.(non decimal numbers entered) ಮೈಂಡ್‌ಮ್ಯಾಪ್‌ಗಳನ್ನು ಡೌನ್‌ಲೋಡ್ ಮಾಡಲು ನಿಮಗೆ ಇಂಟರ್ನೆಟ್ ಸಂಪರ್ಕದ ಅಗತ್ಯವಿದೆ, ದಯವಿಟ್ಟು ನಿಮ್ಮ ಇಂಟರ್ ನೆಟ್ ಅನ್ನು ಆನ್ ಮಾಡಿ ದಿನಗಳು ಹೊಸ ಪ್ರಿಸ್ಕ್ರಿಪ್ಷನ್ ಇದೆ ನೀವು ಪ್ರಿಸ್ಕ್ರಿಪ್ಷನ್ ಹಂಚಿಕೊಳ್ಳಲು ಬಯಸುವ ಮೊಬೈಲ್ ಸಂಖ್ಯೆಯನ್ನು ನಮೂದಿಸಿ. ಹಂಚಿಕೊಳ್ಳಿ ದಯವಿಟ್ಟು ಮೊಬೈಲ್ ಸಂಖ್ಯೆಯನ್ನು ನಮೂದಿಸಿ ಹಂಚಿಕೊಳ್ಳುವ ಮೊದಲು ಪ್ರಿಸ್ಕ್ರಿಪ್ಷನ್ ಅನ್ನು ಡೌನ್‌ಲೋಡ್ ಮಾಡಿ 10 ಅಂಕೆಗಳನ್ನು ನಮೂದಿಸಿ ಡಾಕ್ಯುಮೆಂಟ್- ಲಿಂಗ
